Rules.InvariantScript:
If(
    DatePickerComponent.DisplayMode = "View",
    false,
    Set(
        gblCalendarShow,
        !gblCalendarShow
    )
);
Select(rctReset)

If(
    Value(Self.Text) < 2000,
    Reset(Self),If(IsBlank(gblDateSelected),Set(
        gblFirstDayOfMonth,
        DateValue(
            Text(
                Concatenate(
                    1,
                    "/",
                    Month(Now()),
                    "/",
                    Self.Text
                ),
                "dd/mm/yyyy"
            ),"en-GB"
        )
    );
    Set(
        gblFirstDayInView,
        DateAdd(
            gblFirstDayOfMonth,
            -(Weekday(gblFirstDayOfMonth) - 2 + 1),
            Days
        )
    );
    Set(
        gblLastDayOfMonth,
        DateAdd(
            DateAdd(
                gblFirstDayOfMonth,
                1,
                Months
            ),
            -1,
            Days
        )
    );
    Set(
        gblDateSelected,
        DateValue(
            Text(
                Concatenate(
                    1,
                    "/",
                    Month(Now()),
                    "/",
                    Self.Text
                ),
                "dd/mm/yyyy"
            ),"en-GB"
        )
    ),



    Set(
        gblFirstDayOfMonth,
        DateValue(
            Text(
                Concatenate(
                    1,
                    "/",
                    txtMonthInputDP.Text,
                    "/",
                    Self.Text
                ),
                "dd/mm/yyyy"
            ),"en-GB"
        )
    );
    Set(
        gblFirstDayInView,
        DateAdd(
            gblFirstDayOfMonth,
            -(Weekday(gblFirstDayOfMonth) - 2 + 1),
            Days
        )
    );
    Set(
        gblLastDayOfMonth,
        DateAdd(
            DateAdd(
                gblFirstDayOfMonth,
                1,
                Months
            ),
            -1,
            Days
        )
    );
    Set(
        gblDateSelected,
        DateValue(
            Text(
                Concatenate(
                    Value(txtDayInputDP.Text),
                    "/",
                    txtMonthInputDP.Text,
                    "/",
                    Self.Text
                ),
                "dd/mm/yyyy"
            ),"en-GB"
        )
    ))
)

/*changes month view to previous month*/
Set(gblFirstDayOfMonth, DateAdd(gblFirstDayOfMonth, -1, Months));
Set(gblFirstDayInView, DateAdd(gblFirstDayOfMonth, -(Weekday(gblFirstDayOfMonth) - 2 + 1), Days));
Set(gblLastDayOfMonth, DateAdd(DateAdd(gblFirstDayOfMonth, 1, Months), -1, Days));

/*changes month view to previous month*/
Set(gblFirstDayOfMonth, DateAdd(gblFirstDayOfMonth, -1, Months));
Set(gblFirstDayInView, DateAdd(gblFirstDayOfMonth, -(Weekday(gblFirstDayOfMonth) - 2 + 1), Days));
Set(gblLastDayOfMonth, DateAdd(DateAdd(gblFirstDayOfMonth, 1, Months), -1, Days));

/*changes month view to next month*/
Set(gblFirstDayOfMonth, DateAdd(gblFirstDayOfMonth, 1, Months));
Set(gblFirstDayInView, DateAdd(gblFirstDayOfMonth, -(Weekday(gblFirstDayOfMonth) - 2 + 1), Days));
Set(gblLastDayOfMonth, DateAdd(DateAdd(gblFirstDayOfMonth, 1, Months), -1, Days));

/*changes month view to next month*/
Set(gblFirstDayOfMonth, DateAdd(gblFirstDayOfMonth, 1, Months));
Set(gblFirstDayInView, DateAdd(gblFirstDayOfMonth, -(Weekday(gblFirstDayOfMonth) - 2 + 1), Days));
Set(gblLastDayOfMonth, DateAdd(DateAdd(gblFirstDayOfMonth, 1, Months), -1, Days));

If(
    IsBlank(gblDateSelected),
    Set(
        gblFirstDayOfMonth,
        Date(
            Year(Now()),
            Month(Now()),
            1
        )
    );
    Set(
        gblCalendarShow,
        false
    );
    Set(
        gblErrorShow,
        false
    );
    Set(
        gblFirstDayInView,
        DateAdd(
            gblFirstDayOfMonth,
            -(Weekday(gblFirstDayOfMonth) - 2 + 1),
            Days
        )
    );
    Set(
        gblLastDayOfMonth,
        DateAdd(
            DateAdd(
                gblFirstDayOfMonth,
                1,
                Months
            ),
            -1,
            Days
        )
    ),
    Set(
        gblCalendarShow,
        false
    );
    Set(
        gblErrorShow,
        false
    )
);
If(
    DatePickerComponent.Clear,
    Set(
        gblDateSelected,
        Blank()
    )
);
If(
    !IsBlank(DatePickerComponent.Default),
    Set(
        gblDateSelected,
        DatePickerComponent.Default
    )
)
